(1, 'FORGOT_PASSWORD', 'CSW | Passwort vergessen', '<p xss=\"removed\"><big><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Hallo {user_name},<br>\r\n<br>\r\nmit dem folgenden Link kannst du dein Passwort zurücksetzen:</span></span></span></big></p>\r\n\r\n<p xss=\"removed\"><big><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\"> {reset_link}</span></span></span></big></p>\r\n\r\n<p xss=\"removed\"><big>Solltest du kein neues Passwort angefordert haben, wende dich bitte umgehend an unseren Support unter <a href=\"mailto:support@cloudserviceworld.com?subject=Passwort vergessen\">support@cloudserviceworld.com</a></big></p>\r\n\r\n<p> </p>\r\n\r\n<p><big><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Mit freundlichen Grüßen</span></span></span></big></p>\r\n\r\n<p><big><span xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">dein Team der Cloud Service World</span></span></span></big></p>\r\n', NULL, '1', 1, 0, '2019-04-20 13:54:57', '2021-04-16 17:50:26'),
(2, 'USER_REGISTRATION', 'CSW | Vielen Dank für deine Registrierung', '<p xss=\"removed\"><big>Hallo {user_name},</big></p>\r\n\r\n<p xss=\"removed\"><big>vielen Dank für deine Registrierung bei unserer <a href=\"https://cloudserviceworld.com/\">Cloud Service World</a>. </big></p>\r\n\r\n<p xss=\"removed\"><big>Dein Benutzername lautet: <code xss=\"removed\">{username}</code><br>\r\nFolgende Mailadresse wurde registriert:<code xss=\"removed\"> {email}</code></big></p>\r\n\r\n<p><big>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über support@cloudserviceworld.com</big></p>\r\n\r\n<p><big>Mit freundlichen Grüßen</big></p>\r\n\r\n<p><big>dein Team der Cloud Service World</big></p>\r\n\r\n<p> </p>\r\n', NULL, '1', 1, 0, '2019-04-20 13:58:36', '2021-04-16 17:50:38'),
(3, 'ACTIVATE_EMAIL', 'CSW | Aktivierung des Accounts', '<p><big>Hallo {user_name},</big></p>\r\n\r\n<p><big>bitte klicke auf folgenden Link, um deinen Account zu aktivieren:<br>\r\n{activate_link}</big></p>\r\n\r\n<p><big>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über support@cloudserviceworld.com</big></p>\r\n\r\n<p><big>Mit freundlichen Grüßen</big></p>\r\n\r\n<p><big>dein Team der Cloud Service World</big></p>\r\n', NULL, '1', 1, 0, '2020-07-07 06:22:23', '2021-04-16 17:51:19'),
(4, 'CONTACT_EMAIL', 'CSW | Deine Nachricht ist bei uns eingegangen', '<p><big>Hallo {user_name},</big></p>\r\n\r\n<p><big>Deine Nachricht ist bei uns eingegangen und wird so schnell wie möglich bearbeitet.</big></p>\r\n\r\n<p> </p>\r\n\r\n<p><big>Mit freundlichen Grüßen</big></p>\r\n\r\n<p><big>dein Team der Cloud Service World</big></p>\r\n', NULL, '1', 1, 0, '2020-07-07 06:22:23', '2021-04-16 17:52:35'),
(5, 'ACCOUNT_ACTIVE', 'CSW | Account aktiviert', '<p>Hallo {user_name},</p>\r\n\r\n<p>dein Account wurde erfolgreich aktiviert.<br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, '1', 1, 0, '2020-08-21 20:44:04', '2021-04-16 17:56:28'),
(6, 'ACCOUNT_DEACTIVE', 'CSW | Account deaktiviert', '<p>Hallo {user_name},</p>\r\n\r\n<p>dein Account wurde erfolgreich deaktiviert.<br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, '1', 1, 0, '2020-08-21 20:44:04', '2021-04-16 17:57:25'),
(7, 'ACCOUNT_DELETE', 'CSW | Account gelöscht', '<p>Hallo {user_name},</p>\r\n\r\n<p>dein Account wurde erfolgreich gelöscht.<br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, '1', 1, 0, '2020-08-21 20:44:04', '2021-04-16 17:58:10'),
(13, 'PAYMENT_SUCCESS', 'CSW | Zahlung bestätigt', '<p>Hallo {user_name},</p>\r\n\r\n<p>deine Zahlung in Höhe von {amount} {currency} wurde soeben bestätigt.<br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-01-18 05:07:12', '2021-04-16 17:59:35'),
(15, 'CONTACT_US_REPLY', 'CSW | Ticket bearbeitet', '<p>Hallo {user_name},</p>\r\n\r\n<p>dein Ticket wurde bearbeitet. Nachfolgend findest du unsere Nachricht:</p>\r\n\r\n<p>{reply_data}</p>\r\n\r\n<p>______________________________________________</p>\r\n\r\n<p><strong><em>Deine Anfrage: </em></strong></p>\r\n\r\n<p>{user_message}</p>\r\n\r\n<p>______________________________________________</p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:26:01', '2021-04-16 18:01:27'),
(16, 'CONTACT_US_USER_EMAIL', 'CSW | Eine Nachricht von {user_name}', '<p>Eine neue Nachricht von {user_name}.</p>\r\n\r\n<p>Kundenadresse: {email}</p>\r\n\r\n<p>Nachricht:</p>\r\n\r\n<p>{message_content}</p>\r\n\r\n<p> </p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:47:02', '2021-04-16 18:03:24'),
(18, 'PLAN_SUBSCRIPTION_EMAIL', 'CSW | Service aktiviert', '<p>Hallo {user_name},</p>\r\n\r\n<p>Dein Service wurde gebucht und ist nun aktiv.</p>\r\n\r\n<p>Gebuchter Service: {plan_name}<br>\r\nBeschreibung: {plan_description}<br>\r\nFTP-Speicherplatz : {plan_ftp_space_limit}<br>\r\nDB-Speicherplatz: {plan_db_space_limit}<br>\r\nLaufzeit: {plan_time_period}<br>\r\nLäuft bis: {expiry_date}</p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:47:02', '2021-04-16 18:12:18'),
(19, 'LOW_STORAGE_SPACE_EMAIL_TO_CUSTOMER', 'CSW | WARNUNG: verbleibender Speicherplatz niedrig', '<p><span xss=\"removed\"><span xss=\"removed\">Hallo {user_name},</span></span></p>\r\n\r\n<p><span xss=\"removed\"><span xss=\"removed\">Dein verbleibender Speicherplatz ist gering. Bitte erneuere deinen Service, um ihn ohne Einschränkungen weiter nutzen zu können.</span></span></p>\r\n\r\n<p><span xss=\"removed\"><span xss=\"removed\">Belegter FTP-Speicher: {ftp_percent}</span></span><br>\r\nBelegter DB-Speicher: {db_percent}<br>\r\nAktuell gebuchter Service: {plan_name}<br>\r\nGültig bis: {expiry_date}</p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:47:02', '2021-04-16 18:08:09'),
(20, 'LOW_STORAGE_SPACE_EMAIL_TO_RESELLER', 'CSW | WARNUNG: Geringer Speicherplatz', '<p>Hallo,</p>\r\n\r\n<p>der Speicherplatz bei {user_name} ist bald voll.</p>\r\n\r\n<p><span xss=\"removed\"><span xss=\"removed\">Belegter FTP-Speicher: {ftp_percent}</span></span><br>\r\nBelegter DB-Speicher: {db_percent}<br>\r\nAktuell gebuchter Service: {plan_name}<br>\r\nGültig bis: {expiry_date}</p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:47:02', '2021-04-16 18:10:06'),
(21, 'PLAN_EXPIRY_EMAILS_TO_CUSTOMER', 'CSW | ACHTUNG: Service läuft bald ab', '<p><span xss=\"removed\"><span xss=\"removed\">Hallo {user_name},</span></span></p>\r\n\r\n<p><span xss=\"removed\"><span xss=\"removed\">dein gebuchter Service läuft am {expiry_date} ab. Bitte erneuere diesen, um ihn weiter nutzen zu können.</span></span><br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:47:02', '2021-04-16 18:11:47'),
(22, 'SPACE_UPDATE_REQUEST_APPROVED_TO_CLIENT', 'CSW | Speicher freigegeben', '<p>Hallo {user_name},</p>\r\n\r\n<p>dein gebuchter Speicher ist nun aktiv.</p>\r\n\r\n<p>FTP-Speicherplatz: <span><code>{ftp_space}</code></span><br>\r\nDB-Speicherplatz: <span><code>{db_space}</code></span><br>\r\nKundennummer: <span><code>{no_of_customers}</code></span></p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:47:02', '2021-04-16 18:13:55'),
(23, 'SPACE_UPDATE_REQUEST_UNAPPROVED_TO_CLIENT', 'CSW | Anfrage abgelehnt', '<p>Hallo {user_name},</p>\r\n\r\n<p>leider wurde deine Anfrage für Speicher in unserem System abgelehnt.</p>\r\n\r\n<p>Angefragter FTP-Speicher: <span><code>{ftp_space}</code></span><br>\r\nAngefragter DB-Speicher: <span><code>{db_space}</code></span><br>\r\nKundennummer: <span><code>{no_of_customers}</code></span></p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2021-02-01 10:47:02', '2021-04-16 18:16:39'),
(25, 'USER_CREATION', 'CSW | Account erstellt', '<p>Hallo {user_name},<br>\r\n<br>\r\nvielen Dank für deine Registrierung bei der Cloud Service World.</p>\r\n\r\n<p>Dein Benutzername: {username}</p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2019-04-20 13:58:36', '2021-04-16 18:17:59'),
(26, 'ALIVE_SYSTEM_ERROR', 'CSW | Keep Alive status für {website} ', '<p><span xss=\"removed\"><span xss=\"removed\">Hallo {user_name},<br>\r\n<br>\r\ndie Webseite ({website}) ist nicht mehr erreichbar. Bitte prüfe den Status.</span></span><br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2019-04-20 13:58:36', '2021-04-16 18:18:54'),
(27, 'PLAN_EXPIRED_EMAIL', 'CSW | Service abgelaufen', '<p><span xss=\"removed\"><span xss=\"removed\">Hallo {user_name},</span></span></p>\r\n\r\n<p><span xss=\"removed\"><span xss=\"removed\">dein Service  {plan_name} ist am {expiry_date} abgelaufen. Dein Account wurde deaktiviert. Bitte erneuer deinen Service, um alle Funktionen wieder nutzen zu können.</span></span></p>\r\n\r\n<p>Solltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2019-04-20 13:58:36', '2021-04-16 18:20:13'),
(28, 'REGISTRATION_PASSWORD_SET', 'CSW | Registrierung erfolgreich', '<p><span xss=\"removed\"><span xss=\"removed\">Hallo {user_name},</span></span></p>\r\n\r\n<p>willkommen bei der Cloud Service World. Dein Account wurde erfolgreich aktiviert. Bitte setze über folgenden Link dein persönliches Passwort:</p>\r\n\r\n<p><a href=\"{link}\" target=\"_blank\">Passwort festlegen</a></p>\r\n\r\n<p>Dieser Link ist nur einmal gültig.<br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2019-04-20 13:58:36', '2021-04-16 18:22:29'),
(29, 'PASSWORD_SET', 'CSW | Passwort erfolgreich gesetzt', '<p><span xss=\"removed\"><span xss=\"removed\">Hallo {user_name},</span></span></p>\r\n\r\n<p>dein Passwort wurde erfolgreich gesetzt. Bitte klicke <a href=\"{link}\" target=\"_blank\">hier</a>, um dich mit deinem neuen Passwort einzuloggen.<br>\r\nSolltest du Fragen haben wende dich gerne jederzeit an unseren Support über <a href=\"mailto:support@cloudserviceworld.com\">support@cloudserviceworld.com</a></p>\r\n\r\n<p>Mit freundlichen Grüßen</p>\r\n\r\n<p>dein Team der Cloud Service World</p>\r\n', NULL, NULL, 1, 0, '2019-04-20 13:58:36', '2021-04-16 18:23:27'),
(30, 'ERROR_DATA', 'Error While Taking backup :', '<p>{error_msg}</p>', NULL, NULL, 1, 0, '2019-04-20 13:58:36', '2021-04-16 18:23:27');

